import React from 'react';
import { Container, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import './Home.css';

const Home = () => {
  const navigate = useNavigate();

  return (
    <Container className="text-center py-5 home-container">
      <h1 className="display-4 mb-4">Welcome to ResolveNow</h1>
      <p className="lead">Your reliable partner for quick and easy complaint resolution</p>
      <div className="mt-4">
        <Button variant="primary" className="mx-2 px-4" onClick={() => navigate('/login')}>Login</Button>
        <Button variant="success" className="mx-2 px-4" onClick={() => navigate('/signup')}>Sign Up</Button>
      </div>
    </Container>
  );
};

export default Home;
